t\" title=\"\u0425\u0438\u0434\u0434\u0435\u043d-\u043f\u0438\u043a\">\u0413\u0430\u0448\u0435\u0440\u0431\u0440\u0443\u043c I<\/a> (\u0425\u0438\u0434\u0434\u0435\u043d-\u043f\u0438\u043a), 11-\u044e \u043f\u043e \u0432\u044b\u0441\u043e\u0442\u0435 \u0432\u0435\u0440\u0448\u0438\u043d\u0443 \u043c\u0438\u0440\u0430 .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1959_%D0%B3%D0%BE%D0%B4\" title=\"1959 \u0433\u043e\u0434\">1959<\/a>&#160;\u2014 \u0434\u0435\u043a\u0440\u0435\u0442\u043e\u043c \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BD%D0%B4%D0%BE%D0%BD%D0%B5%D0%B7%D0%B8%D1%8F\" title=\"\u0418\u043d\u0434\u043e\u043d\u0435\u0437\u0438\u044f\">\u0418\u043d\u0434\u043e\u043d\u0435\u0437\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%83%D0%BA%D0%B0%D1%80%D0%BD%D0%BE,_%D0%90%D1%85%D0%BC%D0%B5%D0%B4\" class=\"mw-redirect\" title=\"\u0421\u0443\u043a\u0430\u0440\u043d\u043e, \u0410\u0445\u043c\u0435\u0434\">\u0410\u0445\u043c\u0435\u0434\u0430 \u0421\u0443\u043a\u0430\u0440\u043d\u043e<\/a> \u0431\u044b\u043b\u0430 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0430 \u041a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1945_%D0%B3%D0%BE%D0%B4\" title=\"1945 \u0433\u043e\u0434\">1945 \u0433\u043e\u0434\u0430<\/a>, \u0432 \u0441\u043e\u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0438\u0438 \u0441 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u043d\u0430\u0434\u0435\u043b\u044f\u043b\u0441\u044f \u0437\u043d\u0430\u0447\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u043c\u0438 \u043f\u043e\u043b\u043d\u043e\u043c\u043e\u0447\u0438\u044f\u043c\u0438. \u041e\u0434\u043d\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u043e \u0431\u044b\u043b\u043e \u0440\u0430\u0441\u043f\u0443\u0449\u0435\u043d\u043e \u0438\u043d\u0434\u043e\u043d\u0435\u